function chart1(m1,m2,t,urls,id,title,tick,maxy) {		
	parameters = '?leader_id=' + m1 + '&sub_id=' + m2 + '&type=' + t;
	//urls = ['/monsters/json/graph/since' + parameters,'/monsters/json/graph/monthly' + parameters];
	
	var jxhr = [];
	var result = [];
	var arrSeries = [];
	var labels = [];
	//console.log(urls);
	$.each(urls, function (i, url) {	
		url = '/monsters/json/graph' + parameters + '&graph=' + url
		//console.log(url[0]);
		jxhr.push(
			$.getJSON(url, function (json) {
				result.push(json);
				//console.log(json);
			})
		);

	});
	
	$.when.apply($, jxhr).done(function() {
		
		//console.log(result);
		for (i = 0; i < result.length; i++) { 
			for (j = 0; j < result[i][1].length; j++) {
				var strDate = result[i][1][j][0] + '';
				var arrDate = strDate.split("-");
				//console.log(arrDate[0] + "-" + arrDate[1] + "-" + arrDate[2]);
				result[i][1][j][0] = Date.UTC(arrDate[0],arrDate[1],arrDate[2]);
			}
		}

		$.each(result, function( index, value ) { 
			//console.log(value);
			arrSeries.push({type: 'line', name: value[0], data: value[1]})
		});
		//console.log(arrSeries);
        $(id).highcharts({
            chart: {
                zoomType: 'x'
            },
            title: {
                text: title
            },
            subtitle: {
                text: document.ontouchstart === undefined ?
                        'Click and drag in the plot area to zoom in' : 'Pinch the chart to zoom in'
            },
            xAxis: {
                type: 'datetime'
            },
            yAxis: {
				max: maxy,
				tickInterval: tick,
                title: {
                    text: title
                }
            },
            legend: {
                enabled: true
            },
            plotOptions: {
                area: {
                    fillColor: {
                        linearGradient: {
                            x1: 0,
                            y1: 0,
                            x2: 0,
                            y2: 1
                        },
                        stops: [
                            [0, Highcharts.getOptions().colors[0]],
                            [1, Highcharts.Color(Highcharts.getOptions().colors[0]).setOpacity(0).get('rgba')]
                        ]
                    },
                    marker: {
                        radius: 2
                    },
                    lineWidth: 1,
                    states: {
                        hover: {
                            lineWidth: 1
                        }
                    },
                    threshold: null
                }
            },
            series: arrSeries
        });
	});
}
